import React from 'react'
import './style.css';
import { CategoryList } from '../Types/Interface';





interface Props{
  categoryListItem: CategoryList
}



export default function Header({categoryListItem}:Props) {

  const{categoryName,categoryDatetime}=categoryListItem;

  if (!categoryListItem ) {
    return (

      <div>데이터 없음.</div>
    )
  }
  return (
   <>
   <div className='HeaderWrapper'>
        <div className='HeaderTitle'>개발자's Kiosk</div>
   </div>
   <div className='TabWrapper'>
       <div className='Tab'>{categoryName}</div>

   </div>
   </>
  )
}
